import React from "react";
import {
    Button,
    Card,
    CardBody,
    CardFooter,
    CardTitle,
    Form,
    Input,
    InputGroupAddon,
    InputGroupText,
    InputGroup,
    Container,
    Row,
    Col,
    Fade
} from "reactstrap";
import mechanicalteam from "../../../../data/MechanicalTeam.json";
import electricalTeam from "../../../../data/ElectricalTeam.json";
import softwareTeam from "../../../../data/SoftwareTeam.json";
import businessTeam from "../../../../data/BusinessTeam.json";

function TeamHeads(props){
    let data = {};
    if(props.subsystem === 'mechanical'){
        data = mechanicalteam;
    }
    else if(props.subsystem === 'electrical'){
        data = electricalTeam;
    }
    else if(props.subsystem === 'software'){
        data = softwareTeam;
    }
    else if(props.subsystem === 'business'){
        data = businessTeam;
    }

    return (
        <div>
            <h1>Team Heads</h1>
            <Container>
                    {
                        mechanicalteam.teamData.map((section) => {
                            return (
                                <div>
                                    <Row>
                                        {section.items.map((teamMember) => {
                                            return (
                                                <Col lg="3" md="6" className="team img-col text-center mr-auto ml-auto">
                                                    <div className="member">
                                                        <div className="member-img">
                                                            <div className="overlay">
                                                                <img src={require("assets/img/" + teamMember.image)}
                                                                    className="member-img img-fluid" alt="" />
                                                            </div>
                                                            <div className="social">
                                                                <a href={teamMember.facebook} target='_blank'><i className="fa fa-facebook fa-2x" /></a>
                                                                <a href={teamMember.linkedin} target='_blank'><i className="fa fa-linkedin fa-2x" /></a>
                                                            </div>
                                                        </div>
                                                        <div class="member-info">
                                                            <h4>{teamMember.name}</h4>
                                                            <span>{teamMember.subheading}</span>
                                                        </div>
                                                    </div>
                                                </Col>
                                            )
                                        })}
                                    </Row>
                                </div>
                            )
                        })
                    }
                </Container>
        </div>
    )
}

export default TeamHeads;
